#
# TABLE STRUCTURE FOR: foodnfue_account_prices
#

DROP TABLE IF EXISTS `foodnfue_account_prices`;

CREATE TABLE `foodnfue_account_prices` (
  `id` int(6) NOT NULL AUTO_INCREMENT,
  `account_id` int(6) NOT NULL,
  `R_price` float NOT NULL,
  `D_price` float NOT NULL,
  `F_price` float NOT NULL,
  `N_price` float NOT NULL,
  `E_price` float NOT NULL,
  `C_price` float NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: foodnfue_accounts
#

DROP TABLE IF EXISTS `foodnfue_accounts`;

CREATE TABLE `foodnfue_accounts` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `account` int(13) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `address1` varchar(50) DEFAULT NULL,
  `address2` varchar(50) DEFAULT NULL,
  `city` varchar(25) DEFAULT NULL,
  `state` varchar(2) DEFAULT NULL,
  `zip` varchar(20) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `fax` varbinary(20) DEFAULT NULL,
  `contact` varchar(50) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_cards
#

DROP TABLE IF EXISTS `foodnfue_cards`;

CREATE TABLE `foodnfue_cards` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `account_id` int(13) NOT NULL,
  `card_id` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=350 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_companies
#

DROP TABLE IF EXISTS `foodnfue_companies`;

CREATE TABLE `foodnfue_companies` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `company_id` varchar(3) NOT NULL,
  `client_consolidation` int(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_configs
#

DROP TABLE IF EXISTS `foodnfue_configs`;

CREATE TABLE `foodnfue_configs` (
  `order_num` int(3) NOT NULL,
  `name` varchar(50) COLLATE utf8_bin NOT NULL,
  `value` text COLLATE utf8_bin NOT NULL,
  `comment` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`name`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;



#
# TABLE STRUCTURE FOR: foodnfue_departments
#

DROP TABLE IF EXISTS `foodnfue_departments`;

CREATE TABLE `foodnfue_departments` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `account_id` int(6) NOT NULL,
  `department_id` varchar(10) NOT NULL,
  `department_name` varchar(30) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: foodnfue_invoice_items
#

DROP TABLE IF EXISTS `foodnfue_invoice_items`;

CREATE TABLE `foodnfue_invoice_items` (
  `id` bigint(11) unsigned NOT NULL AUTO_INCREMENT,
  `invoice_id` bigint(11) unsigned NOT NULL,
  `ptdata_id` bigint(11) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: foodnfue_invoices
#

DROP TABLE IF EXISTS `foodnfue_invoices`;

CREATE TABLE `foodnfue_invoices` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `invoice_no` int(8) NOT NULL,
  `date` varchar(20) NOT NULL,
  `account_id` int(6) NOT NULL,
  `start_pt_date` varchar(10) NOT NULL,
  `end_pt_date` varchar(10) NOT NULL,
  `total_price` float NOT NULL DEFAULT '0',
  `calc_method` enum('cfn','pump') NOT NULL DEFAULT 'pump',
  `state` enum('Pending','Completed') NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: foodnfue_payments
#

DROP TABLE IF EXISTS `foodnfue_payments`;

CREATE TABLE `foodnfue_payments` (
  `id` bigint(11) unsigned NOT NULL AUTO_INCREMENT,
  `account_id` bigint(11) NOT NULL,
  `date` varchar(16) NOT NULL,
  `charge` double(10,2) NOT NULL DEFAULT '0.00',
  `deposit` double(10,2) NOT NULL DEFAULT '0.00',
  `description` text NOT NULL,
  `invoice_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: foodnfue_products
#

DROP TABLE IF EXISTS `foodnfue_products`;

CREATE TABLE `foodnfue_products` (
  `id` int(13) NOT NULL AUTO_INCREMENT,
  `product_code` int(6) NOT NULL,
  `product_type` varchar(20) NOT NULL,
  `product_description` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_ptdatas
#

DROP TABLE IF EXISTS `foodnfue_ptdatas`;

CREATE TABLE `foodnfue_ptdatas` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `site_id` int(6) NOT NULL,
  `sequence` int(4) DEFAULT NULL,
  `status_code` int(2) DEFAULT NULL,
  `total_amount` float DEFAULT NULL,
  `transaction_type` int(2) DEFAULT NULL,
  `product_id` bigint(11) NOT NULL,
  `price` float DEFAULT NULL,
  `quantity` float DEFAULT NULL,
  `odometer` int(7) DEFAULT NULL,
  `pump_number_or_register_number` int(2) DEFAULT NULL,
  `transaction_number` int(4) DEFAULT NULL,
  `date_completed` varchar(10) NOT NULL,
  `time_completed` varchar(5) NOT NULL,
  `error_code` int(2) DEFAULT NULL,
  `authorization_number` int(6) DEFAULT NULL,
  `manual_entry` int(8) DEFAULT NULL,
  `card_id` varchar(7) NOT NULL,
  `site_type` varchar(5) DEFAULT NULL,
  `pump_price` float NOT NULL DEFAULT '0',
  `cfn_price` float NOT NULL DEFAULT '0',
  `is_checked` tinyint(1) NOT NULL DEFAULT '0',
  `company_id` varchar(3) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4079 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_sessions
#

DROP TABLE IF EXISTS `foodnfue_sessions`;

CREATE TABLE `foodnfue_sessions` (
  `id` varchar(128) NOT NULL,
  `ip_address` varchar(45) NOT NULL,
  `timestamp` int(10) unsigned NOT NULL DEFAULT '0',
  `data` blob NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ci_sessions_timestamp` (`timestamp`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_site_products
#

DROP TABLE IF EXISTS `foodnfue_site_products`;

CREATE TABLE `foodnfue_site_products` (
  `id` int(13) NOT NULL AUTO_INCREMENT,
  `site_id` int(13) NOT NULL,
  `product_id` int(13) DEFAULT NULL,
  `product_code` varchar(20) DEFAULT NULL,
  `price` float NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: foodnfue_sites
#

DROP TABLE IF EXISTS `foodnfue_sites`;

CREATE TABLE `foodnfue_sites` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `site_id` int(13) NOT NULL,
  `site_name` varchar(40) NOT NULL,
  `participant` varchar(50) NOT NULL,
  `address` varchar(50) NOT NULL,
  `city` varchar(30) NOT NULL,
  `city_code` int(5) NOT NULL,
  `county_code` int(5) NOT NULL,
  `state` varchar(10) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `c_store` varchar(5) NOT NULL,
  `zip` int(5) NOT NULL,
  `type` varchar(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2585 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_userinfos
#

DROP TABLE IF EXISTS `foodnfue_userinfos`;

CREATE TABLE `foodnfue_userinfos` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(11) NOT NULL,
  `fullname` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `phone` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_users
#

DROP TABLE IF EXISTS `foodnfue_users`;

CREATE TABLE `foodnfue_users` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL COMMENT 'username',
  `password` varchar(100) NOT NULL,
  `group` enum('admin','user') NOT NULL DEFAULT 'user',
  `status` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: foodnfue_vehicles
#

DROP TABLE IF EXISTS `foodnfue_vehicles`;

CREATE TABLE `foodnfue_vehicles` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `account_id` int(13) NOT NULL,
  `vehicle_id` varchar(13) NOT NULL,
  `vehicle_description` varchar(25) DEFAULT NULL,
  `card_id` int(13) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=350 DEFAULT CHARSET=utf8;



